from itertools import product
class Solution:
    def maximalSquare(self, matrix: [[str]]) -> int:
        m, n, ans = len(matrix), len(matrix[0]), 0
        dp = [[0]*(n+1) for _ in range(2)]

        for i, j in product(range(m-1, -1, -1), range(n-1, -1, -1)):
            dp[i&1][j] = 1 + min(dp[(i+1)&1][j+1], dp[(i+1)&1][j], dp[i&1][j+1]) if matrix[i][j] == '1' else 0
            ans = max(dp[i&1][j], ans)

        return ans*ans

